ControlPropertyState.AutoRuleBindingString:
//Go to results page, pass chosen values from this (Search Page) to the Results page
Navigate(
    'Results Screen',
    ScreenTransition.Cover,
    {
        _region: drpRegion.SelectedText,
        _building: drpBuilding.SelectedText,
        _floor: drpFloor.SelectedText,
        _neighbourhood: drpNeighbourhood.SelectedText,
        _seatingType: drpSeatingType.SelectedText,
        _date: DatePicker.SelectedDate,
        _timeRange: drpTimeRange.SelectedText
    }
);

Table(
    {
        Key: "profile",
        Label: "Profile_PH",
        NavigationLink: App.ActiveScreen
    },
    {
        Label: "NewBooking_PH",
        NavigationLink: App.ActiveScreen
    }
)

UpdateContext(
    {
        _isLoadingVisible: false,
        locIsDoneLoadingVisible: false,
        locStartLoadingTimer: true,
        locLoadingDuration: gblBaseLoadTime
    }
);
ClearCollect(
    FloorCollection,
    {floor_name: LookUp(colTranslationTable, key = "bookingsearch.floor.default" && language.Value = AppUserLang, text)},
    Floors
);
UpdateContext({locLoadingDuration: 0});

UpdateContext(
    {
        _isLoadingVisible: false,
        locIsDoneLoadingVisible: false,
        locStartLoadingTimer: true,
        locLoadingDuration: gblBaseLoadTime
    }
);
ClearCollect(
    NeighbourhoodCollection,
    {name: neighbourhoodDefaultText},
    Neighbourhoods
);
UpdateContext({locLoadingDuration: 0});

UpdateContext(
    {
        _isLoadingVisible: false,
        locIsDoneLoadingVisible: false,
        locStartLoadingTimer: true,
        locLoadingDuration: gblBaseLoadTime
    }
);
ClearCollect(
    SeatingTypeCollection,
    {seating_type: seatingTypeDefaultText},
    SeatingTypes
);
UpdateContext({locLoadingDuration: 0});

//Call Loading animation
UpdateContext(
    {
        _isLoadingVisible: false,
        locIsDoneLoadingVisible: false,
        locStartLoadingTimer: true,
        locLoadingDuration: gblBaseLoadTime
    }
);
//Conditionally Retrieve Building Columns Based on Language 
ClearCollect(
    BuildingCollection,
    Switch(
        AppUserLang, "en",
        {
            building_name_en: LookUp(
                Translations,
                key = "bookingsearch.building.default" && language.Value = AppUserLang,
                text
            )
        }, "fr",
        {
            building_name_fr: LookUp(
                Translations,
                key = "bookingsearch.building.default" && language.Value = AppUserLang,
                text
            )
        }
    ),
    Switch(AppUserLang, "en", ShowColumns(Buildings, "ID", "building_name_en"), ShowColumns(Buildings, "ID", "building_name_fr"))
);
//End Loading Animation - In turn, turns on done animation
UpdateContext({locLoadingDuration: 0});

Concurrent (
    UpdateContext(
        {
            buildingDefaultTextEN: "Select Your Building",
            floorDefaultText: "Select Your Floor",
            neighbourhoodDefaultText: "Select Your Neighbourhood",
            seatingTypeDefaultText: "Select Your Seating Type"
        }
    ),
    UpdateContext(
        {
            _isLoadingVisible: false,
            locIsDoneLoadingVisible: false,
            locStartLoadingTimer: true,
            locStartDoneTimer: false,
            locLoadingDuration: gblBaseLoadTime,
            locDateError: "None"
        }
    )
);
If(
    AppUserLang = "en",
    ClearCollect(
        RegionCollection,
        {
            region_name_en: LookUp(
                Translations,
                key = "bookingsearch.region.default" && language.Value = "en",
                text
            )
        },
        ShowColumns(
            Regions,
            "region_name_en",
            "ID"
        )
    ),
    ClearCollect(
        RegionCollection,
        {
            region_name_fr: LookUp(
                Translations,
                key = "bookingsearch.region.default" && language.Value = "fr",
                text
            )
        },
        ShowColumns(
            Regions,
            "region_name_fr",
            "ID"
        )
    )
);
UpdateContext({locLoadingDuration: 0});
